import React from 'react';
import Img from './twitter.png';


export default function Nav() {
    return (
        <nav className='nav-container box-shadow'>
           <img src={Img} alt=""
           className='Nav'
           />
           <h1>Jay-Den</h1>
        </nav>
    )
}
